import React from "react";

import classes from "./MyFriendsInfo.module.css";

const MyFriendsInfo = () => {
  const fetchAllFriendsId = async () => {
    const reqOptions = {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        id: localStorage.getItem("isLoggedIn"),
      }),
    };
    try {
      const response = await fetch(
        "http://localhost:8080/getallmyfriendsid",
        reqOptions
      );
      if (!response.ok) {
        throw new Error("Something went wrong");
      }
      const body = await response.json();
      console.log(body);
    } catch (error) {
      console.log(error.message);
    }
  };
  fetchAllFriendsId();

  return (
    <div className={classes.friendsinfo}>
      <h1>My friends</h1>
    </div>
  );
};

export default MyFriendsInfo;
